import { Component } from "react";

export default class Line extends Component {

    constructor(props)
    {
        super(props);
        this.data = [props.data]
    }

    render() {
        var line = null;

        if (this.data[1] === "PRCP")
        {
            line = (
                <div>
                    <p>Precipitation: {parseFloat(this.data[2])/10} mm</p>
                </div>
            )
        }
        else{
            line = (
                <p>Empty</p>
            )
        }

        return line;
    }
}
